import React, {Component} from 'react';
import './SongStyle/SongStyle.css';



class Song extends Component{
    render(){
      return(
        <div className = 'SongText'>
            <songHead compName = 'Billie Eilish' name = 'All The Good Girls Go to Hell' capo = '4th thret'/>
        </div>
      );
    }

}

const songHead = props =>(
    <div>
        <span><h1>{props.compName}</h1> - <h2>{props.name}</h2></span>
        <span><h6>Capo</h6>: {props.capo}</span>
        <span>----------------------------</span>
    </div>
);


  export default Song;
